  return (
    <div className="App">
      <Switch>
      {/* <MovieList/>
      <Description/> */}
      <Route path= "/Description" render={(props)=> <Description {...props}/>}/>
      <Route  exact path= "/" component={MovieList}/> 
      </Switch>
    </div>
  );
}

export default App;
